import React from 'react';
import  classes from "./Profile.module.css";
import MyPosts from './Myposts/MyPosts';

const Profile = () => {
    return (
      <div className={classes.content}>
      <div>
        <img src="" alt=""></img>
      </div>
      <div>
        ava+description
      </div>
      <MyPosts />
    </div>
    );
}

export default Profile;
